@font-face {
    font-family: RobotoCondensed;
    src: url(bcc3453643980c72f35684516709adf4.ttf);
    font-weight: 800;
}

@font-face {
    font-family: EconomicaBold;
    src: url(f17271936c78ae1ec15f283512a9e27d.ttf);
}

body {
    text-align: center;
    font-size: 18px;
    padding: 2.5%;
    font-family: 'RobotoCondensed';
}

h1, h2, h3, h4, h5 {
    font-family: 'EconomicaBold';
}

hr {
    height: 1px;
    background: black;
}

.buttons {
    width: 30%;
    height: 50%;
    object-fit: cover;
    border-radius: 50px;
    border: 3px solid #555;
    margin: 10px 10px 10px 10px;
}

.buttons:hover {
    opacity: 60%;
    box-shadow: 8px 8px;
}

.logo {
    width: 700px;
    height: 288px;
    border-radius: 50px;
    border: 3px solid #555;
    margin: 2px;
}

.figure {
    width: 250px;
    height: 350px;
    position: relative;
    display: inline-block;
    margin:70px 20px 70px 20px;
    cursor: pointer;
    padding: 5px;
}

.figure:hover {
    opacity: 70%;
}

.figure-image {
    width: 250px;
    height: 350px;
    object-fit: cover;
}

.figure-text {
    position: absolute;
    width: 250px;
    bottom: -100px;
    padding: 10px;
    text-align: left;
}
